import React from 'react';
import {Div, Img, P} from './profile';
import {UserOutlined} from "@ant-design/icons";

const Profile = ({user}) => {

    console.log(user)

    return (
        <Div container>
            <Div header>
                <Div img>
                    <Img src={process.env.PUBLIC_URL + '/Img/user-icon.jpeg'}/>
                    <P style={{color:"#fff"}}>{user.nick}</P>
                </Div>

                <Div line>
                    <p>0</p>
                    <p>게시물</p>
                </Div>
                <Div line>
                    <p>
                        {
                            user.Followings && Object.keys(user.Followings).length
                        }
                    </p>
                    <p>팔로잉</p>
                </Div>
                <Div line>
                    <p>
                        {
                            user.Followers && Object.keys(user.Followers).length
                        }
                    </p>
                    <p>
                        팔로워
                    </p>
                </Div>
            </Div>
        </Div>
    );
};

export default Profile;
